    position: absolute;
    top: 0;
  }
  .burger-menu_button {
    position: fixed;
    top: 30px;
    right: 50px;
    z-index: 12;
    border-radius: 50%;
    -webkit-transition: 0.4s;
    -moz-transition: 0.4s;
    -o-transition: 0.4s;
    transition: 0.4s;
  }
  .burger-menu_lines::before,
.burger-menu_lines::after,
.burger-menu_lines {
    position: absolute;
    width: 35px;
    height: 3px;
    background-color: #FFFFFF;
    transition: 0.2s;
  }
  .burger-menu_lines {
    top: 37%;
    left: 50%;
    transform: translate(-50%, -50%);
  }
  .burger-menu_lines::before {
    content: "";
    top: -12px;
  }
  .burger-menu_lines::after {
    content: "";
    top: 12px;
  }
  .active .burger-menu_lines {
    background-color: transparent;
  }
  .active .burger-menu_lines::before {
    top: 0;
    transform: rotate(45deg);
  }
  .active .burger-menu_lines::after {
    top: 0;
    transform: rotate(-45deg);
  }
