.burger-menu_nav, .burger-menu_overlay, .burger-menu{
    display: none;
}

@media (max-width: 600px){
    .burger-menu {
        display: block;
        position: absolute;
        top: 0;
    }
    .burger-menu_button {
        position: fixed;
        top: 30px;
        right: 50px;
        z-index: 12;
        border-radius: 50%;
        -webkit-transition: 0.4s;
        -moz-transition: 0.4s;
        -o-transition: 0.4s;
        transition: 0.4s;
    }
    
    .burger-menu_lines::before,
    .burger-menu_lines::after,
    .burger-menu_lines {
        position: absolute;
        width: 35px;
        height: 3px;
        background-color: $white;
        transition: 0.2s;
    }
    .burger-menu_lines {
        top: 37%;
        left: 50%;
        transform: translate(-50%, -50%);
    }
    .burger-menu_lines::before {
        content: '';
        top: -12px;
    }
    .burger-menu_lines::after {
        content: '';
        top: 12px;
    }
    
    
    .active .burger-menu_lines {
        background-color: transparent;
    }
    .active .burger-menu_lines::before {
        top: 0;
        transform: rotate(45deg);
    }
    .active .burger-menu_lines::after{
        top: 0;
        transform: rotate(-45deg);
    }
    .burger-menu_nav__list {
        margin-bottom: 50px;
        text-align: center;
    }
    .burger-menu_nav {
        width: 100%;
        padding-top: 120px;
        position: fixed;
        top: 0;
        z-index: 11;
        display: flex;
        flex-flow: column;
        height: 100%;
        background-color: #000000;
        overflow-y: auto;
        right: -100%;
        -webkit-transition: 0.8s;
        -moz-transition: 0.8s;
        -o-transition: 0.8s;
        transition: 0.8s;
    }
    .active .burger-menu_nav {
        right: 0;
        -webkit-transition: 0.4s;
        -moz-transition: 0.4s;
        -o-transition: 0.4s;
        transition: 0.4s;
    }
    .burger-menu_link {
        @include OpenSans-SemiBold-s;
        text-transform: capitalize;
        padding: 24px 20px;
        color: $white;
    }
    .burger-menu_link:hover {
        filter: brightness(0.9);
    }
}
